import React, { Component } from 'react';
// import '../css/About.css';
class About extends Component {
  render() {
    return (
      <div className="About">
        <h1>About</h1>
        <p>
          My name is Jin Ai. I graduated from Yale in Art and I am a full stack web developer with experience in Ruby on Rails, React.js, and React-Redux.
        </p>

        <p>
          I like climbing, computer music, and cats.
        </p>

        <p>
          Technical skills: JavaScript, Ruby on Rails, React.js, React-Redux, HTML, CSS, SQL, Adobe Creative Cloud
        </p>
      </div>
    );
  }
}

export default About;
